import AuthNav from "./Auth/AuthNav";


function Header()
{
    return(
        <header>
            <div className="nav-wrapper">
            <div className="header">
            <ul className="left hide-on-med-and-down"></ul>
            NSCC Full Stack Inc.
            <AuthNav/>
            </div>
            </div>
        </header>
    )
}


export default Header;
